To perform text-to-speech (TTS) in Rust, you can use the `flite` library, which is a lightweight and easy-to-use TTS engine for Rust. You can use `flite` to convert text to speech and play it through the system's default audio output.

Here is some example code that demonstrates how you might use these libraries to create a Rust app that supports the ElevenLabs API and can read the contents of the clipboard aloud using TTS:
